    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = 'project:init';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'Initialiser le projet';
    public $dataTypes = [];
    public $dataRows = [];
    public $relationShip = [];
    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct()
    {
        parent::__construct();
    }

    /**
     * Execute the console command.
     *
     * @return int
     */
    public function handle(Filesystem $filesystem)
    {
        $this->info('Publishing the ZDSLab/LaravelInit assets, database, and config files');

        // Publish only relevant resources on install
        $tags = ['seeds'];

        $this->call('vendor:publish', ['--provider' => VoyagerServiceProvider::class, '--tag' => $tags]);


        //Création des models
        $this->initModels();
        // Migration creation
        $this->initMigrations();
        //Voyager install
        $this->initVoyager();
        //Creation des controllers
        $this->initController();
        //Views
        $this->initViews();
        //init Bread
        $this->initBread();
        $this->updateFile($filesystem);
        return 0;
    }
