    public function initController()
    {

        $dataController = <<<DataController
            <?php

            namespace App\Http\Controllers;

            use Illuminate\Http\Request;
            use Illuminate\Support\Arr;
            use App\Models\Slider;
            use App\Models\Page;
            use App\Models\Template;
            use App\Models\User;

            class DataController extends Controller
            {

                public static function index(){
                    return self::makePage('home');
                }
                public static function makePage(\$slug = NULL){
                    \$slug = \$slug ?? 'home';
                    \$query = Page::with(
                            [
                                'sections' => function(\$q){
                                    \$q->orderBy('rang', 'ASC');
                                },
                                'template',
                                'keywords:word'
                        ]
                    );
                    \$page = \$query->where('slug', strtolower(\$slug))->get()->toArray()[0] ?? [];
                    if(!\$page):
                        \$slug = 'home';
                        \$query = Page::with(
                            [
                                'sections' => function(\$q){
                                    \$q->orderBy('rang', 'ASC');
                                },
                                'template',
                                'keywords:word'
                            ]
                        );
                        \$page = \$query->where('slug', 'home')->get()->toArray()[0] ;
                    endif;
                    \$data['template'] = \$page['template']['vue'] ?? 'master';
                    \$data['pageName'] = \$page['name'] ?? env('APP_NAME');
                    \$data['pageTitle'] = \$page['title'] ?? NULL;
                    \$data['page'] = \$page;
                    \$data['pageKeywords'] = \$page['keywords'] ?? NULL ;
                    \$data['pageDescription'] = \$page['description'] ?? NULL ;
                    \$lesSections = \$page['sections'] ?? [];
                    \$data['tabSection'] = [];
                    \$data['slug'] = \$slug;
                    foreach(\$lesSections AS \$sect):
                        \$data['tabSection'][] = \$sect['vue'];
                    endforeach;
                    \$data['tabSection'] = \$page['sections'] ?? [];
                    \$data['data'] = self::getData(\$data['tabSection']);
                    \$data['tabSection'] = Arr::keyBy(\$data['tabSection'], 'vue');
                    return view('page', \$data);
                }
                public static function getSlider(){
                    return self::arrayByKey(Slider::with('boutons')->where('active', true)
                            ->orderBy('rang', 'ASC')->get()->toArray());
                }
                public static function getData(array \$sections): array{
                    \$data = [];
                    foreach(\$sections AS \$section):
                        \$method  = "get".ucfirst(\$section['vue']);
                        if(method_exists(self::class, \$method)):
                            \$data[\$section['vue']] = call_user_func("self::\$method") ;
                        endif;
                    endforeach;
                    return \$data;
                }

                public static function getThumbnailImage(string \$image, \$suffixe = 'cropped'): string{
                    \$extension = pathinfo(\$image)[ "extension"];
                    return str_replace(".\$extension", "-\$suffixe.\$extension", \$image);

                }

                public static function arrayByKey(array \$array, string \$key = 'id'): array{
                    \$data = [];
                    foreach(\$array AS \$k => \$r):
                        if(array_key_exists(\$key, \$r)):
                            \$data[\$r[\$key]] = \$r;
                        else:
                            \$data[\$k] = \$r;
                        endif;
                    endforeach;
                    return \$data;
                }

                public static function arrayGroupByKey(array \$array, string \$key = NULL): array{
                    if(!\$key):
                        return \$array;
                    endif;
                    \$data = [];
                    foreach(\$array AS \$k => \$r):
                        if(array_key_exists(\$key, \$r)):
                            \$data[\$r[\$key]][] = \$r;
                        else:
                            \$data[\$k] = \$r;
                        endif;
                    endforeach;
                    return \$data;
                }
            }
        DataController;

        $pageSectionOrderController = <<<PageSectionOrderController
            <?php

            namespace App\Http\Controllers;

            use App\Models\Page;
            use App\Models\Section;
            use Illuminate\Http\Request;
            use TCG\Voyager\Http\Controllers\VoyagerBaseController;
            use TCG\Voyager\Facades\Voyager;

            class PageSectionOrderController extends VoyagerBaseController
            {
                //

                /**
                 * Order BREAD items.
                 *
                 * @param string \$table
                 *
                 * @return \Illuminate\Contracts\View\Factory|\Illuminate\View\View
                 */
                public function order(Request \$request, \$page_id = 0)
                {
                    \$slug = "page-sections";

                    \$dataType = Voyager::model('DataType')->where('slug', '=', \$slug)->first();

                    // Check permission
                    \$this->authorize('edit', app(\$dataType->model_name));

                    if (empty(\$dataType->order_column) || empty(\$dataType->order_display_column)) {
                        return redirect()
                        ->route("voyager.{\$dataType->slug}.index")
                        ->with([
                            'message'    => __('voyager::bread.ordering_not_set'),
                            'alert-type' => 'error',
                        ]);
                    }

                    \$model = app(\$dataType->model_name);
                    \$query = \$model->query();
                    if (\$model && in_array(SoftDeletes::class, class_uses_recursive(\$model))) {
                        \$query = \$query->withTrashed();
                    }
                    \$lesSections = [];
                    \$lesPages = [];
                    \$results = [];
                    if(\$page_id):
                        \$results = \$query->where('page_id', \$page_id)->orderBy(\$dataType->order_column, \$dataType->order_direction)->get();
                        \$lesSectionsBrutes = Section::get(['id','name'])->toArray();
                        \$lesSections = [];
                        foreach (\$lesSectionsBrutes as \$v) :
                            \$lesSections[\$v['id']] = \$v['name'] ;
                        endforeach;
                    endif;
                    \$pages = Page::orderBy('name', 'ASC')->get(['id', 'name', 'slug'])->toArray();
                    foreach(\$pages AS \$page):
                        \$lesPages[\$page['id']] = \$page;
                    endforeach;
                    \$display_column = \$dataType->order_display_column;

                    \$dataRow = Voyager::model('DataRow')->whereDataTypeId(\$dataType->id)->whereField(\$display_column)->first();

                    \$view = 'voyager::bread.order';

                    if (view()->exists("voyager::\$slug.order")) {
                        \$view = "voyager::\$slug.order";
                    }

                    return Voyager::view(\$view, compact(
                        'dataType',
                        'display_column',
                        'dataRow',
                        'results',
                        'page_id',
                        'lesSections',
                        'lesPages'
                    ));
                }

            }
        PageSectionOrderController;

        $controllers = [
            'DataController.php' => $dataController,
            'PageSectionOrderController.php' => $pageSectionOrderController,
        ];

        $this->putFileInFolder($controllers, app_path('Http/Controllers/'));
    }
    function putFileInFolder($files, $path)
    {
        foreach ($files as $name => $content) :
            $chemin =  $path . $name;
            $path_info = pathinfo($chemin);
            $dir = $path_info['dirname'];
            if (!file_exists($dir)) :
                mkdir($dir, 0775, true);
            endif;
            file_put_contents($chemin, trim($content));
        endforeach;
    }

